import getCookie from "./getCookie";

const csrftoken = getCookie('csrftoken');

export async function deleteData(url, type) {
    const response = await fetch(`${url}/delete/`, {
        method: "POST",
        body: {"to_delete": type},
        // credentials: "include",
    })
    return response
}
